/*
https://leetcode.com/problems/contiguous-array/

Given a binary array, find the maximum length of a contiguous subarray with equal number of 0 and 1.
*/

/*
O(n)
Runtime: 292 ms, faster than 100.00% of PHP online submissions for Contiguous Array.
Memory Usage: 21.6 MB, less than 100.00% of PHP online submissions for Contiguous Array.
*/
class Solution {

    /** 10:21 - 10:34  Time Limit - (breakfast, reading solution) - 11:35 - 11:45
     * @param Integer[] $nums
     * @return Integer
     */
    function findMaxLength($nums) {
        $hash = [];
        $hash[0] = -1;
        $count = 0;
        $max = 0;
        
        for ($i = 0; $i < count($nums); $i++) {
            if ($nums[$i] == 0) $count--;
            if ($nums[$i] == 1) $count++;
            
            if (isset($hash[$count])) {
                $max = max($max, $i - $hash[$count]);
            } else {
                $hash[$count] = $i;
            }
        }
        
        return $max;
    }
}


// O(n^2), Time Limit
class Solution {

    /** 10:21 - 10:34
     * @param Integer[] $nums
     * @return Integer
     */
    function findMaxLength($nums) {
        $zero = 0;
        $one = 0;
        $current = 0;
        $max = 0;
        
        for ($j = 0; $j < count($nums); $j++) {
            for ($i = $j; $i < count($nums); $i++) {
                if ($nums[$i] == 0) $zero++;
                if ($nums[$i] == 1) $one++;
                if ($zero == $one) $current = $zero + $one;
                $max = max($current, $max);
            }
            $zero = 0;
            $one = 0;
            $current = 0;
        }
        
        return $max;
    }
}

